def move_one_ball(arr):
    """
    Determine if it is possible to sort the array in non-decreasing order by
    performing right shift operations.
    """
    if not arr:
        return True
    count = 0
    n = len(arr)
    for i in range(1, n):
        if arr[i] < arr[i-1]:
            count += 1
            if count > 1:
                return False
    if count == 1 and arr[0] < arr[-1]:
        return False
    return True

def histogram(text):
    words = text.split()
    frequency = {}
    for word in words:
        if word in frequency:
            frequency[word] += 1
        else:
            frequency[word] = 1
    max_freq = max(frequency.values(), default=0)
    return {k: v for k, v in frequency.items() if v == max_freq}

