def intersection(interval1, interval2):
    def is_prime(n):
        if n <= 1:
            return False
        for i in range(2, int(n**0.5) + 1):
            if n % i == 0:
                return False
        return True

    start_max = max(interval1[0], interval2[0])
    end_min = min(interval1[1], interval2[1])
    if start_max > end_min:
        return "NO"

    intersection_length = end_min - start_max
    return "YES" if is_prime(intersection_length) else "NO"

def prod_signs(arr):
    if not arr:
        return None
    product_of_signs = 1
    sum_of_magnitudes = 0
    for num in arr:
        product_of_signs *= (1 if num > 0 else -1 if num < 0 else 0)
        sum_of_magnitudes += abs(num)
    return sum_of_magnitudes * product_of_signs

from heapq import heappush, heappop

def minPath(grid, k):
    N = len(grid)
    directions = [(0, 1), (1, 0), (-1, 0), (0, -1)]
    visited = set()
    pq = []

    for i in range(N):
        for j in range(N):
            heappush(pq, (grid[i][j], 1, [(i, j)], grid[i][j]))

    while pq:
        _, length, path, value = heappop(pq)
        if length == k:
            return [grid[x][y] for x, y in path]
        for dx, dy in directions:
            x, y = path[-1]
            nx, ny = x + dx, y + dy
            if 0 <= nx < N and 0 <= ny < N and (nx, ny, length + 1) not in visited:
                visited.add((nx, ny, length + 1))
                newPath = path + [(nx, ny)]
                newValue = value * (N * N) + grid[nx][ny]
                heappush(pq, (newValue, length + 1, newPath, newValue))

def tri(n):
    if n == 0:
        return [1]
    if n == 1:
        return [1, 3]
    if n == 2:
        return [1, 3, 2]

    # Initialize the list with the first three values
    tribonacci = [1, 3, 2]

    # Calculate the next values up to n
    for i in range(3, n + 1):
        if i % 2 == 0:
            tribonacci.append(1 + i / 2)
        else:
            tribonacci.append(tribonacci[i - 1] + tribonacci[i - 2] + tribonacci[i - 3])

    return tribonacci

