def is_multiply_prime(a):
    def is_prime(n):
        if n <= 1:
            return False
        for i in range(2, int(n**0.5) + 1):
            if n % i == 0:
                return False
        return True

    if a < 2:
        return False

    prime_factors = 0
    for i in range(2, a + 1):
