from heapq import heappush, heappop

def minPath(grid, k):
    N = len(grid)
    directions = [(0, 1), (1, 0), (-1, 0), (0, -1)]
    pq = [(grid[i][j], 1, i, j, [grid[i][j]]) for i in range(N) for j in range(N)]
    visited = set()

    while pq:
        cost, length, x, y, path = heappop(pq)
        if (x, y, length) in visited:
            continue
        visited.add((x, y, length))
        if length == k:
            return path
        for dx, dy in directions:
            nx, ny = x + dx, y + dy
            if 0 <= nx < N and 0 <= ny < N:
                new_path = path + [grid[nx][ny]]
                heappush(pq, (cost, length + 1, nx, ny, new_path))

