from heapq import heappush, heappop

def minPath(grid, k):
    N = len(grid)
    moves = [(0, 1), (1, 0), (-1, 0), (0, -1)]
    pq = []
    for i in range(N):
        for j in range(N):
            heappush(pq, (grid[i][j], 1, [(i, j)], grid[i][j]))

    visited = set()

    while pq:
        _, length, path, val = heappop(pq)
        if (path[-1], length) in visited:
            continue
        visited.add((path[-1], length))
        if length == k:
            return [grid[x][y] for x, y in path]
        for dx, dy in moves:
            x, y = path[-1]
            nx, ny = x + dx, y + dy
            if 0 <= nx < N and 0 <= ny < N:
                newPath = path + [(nx, ny)]
                newVal = val * (N*N) + grid[nx][ny]
                heappush(pq, (newVal, length + 1, newPath, newVal))

