from heapq import heappush, heappop

def minPath(grid, k):
    N = len(grid)
    directions = [(0, 1), (1, 0), (-1, 0), (0, -1)]
    min_heap = [(grid[i][j], i, j, [(grid[i][j])]) for i in range(N) for j in range(N)]
    visited = set()

    while min_heap:
        _, x, y, path = heappop(min_heap)
        if (x, y, len(path)) in visited:
            continue
        visited.add((x, y, len(path)))
        if len(path) == k:
            return path
        for dx, dy in directions:
            nx, ny = x + dx, y + dy
            if 0 <= nx < N and 0 <= ny < N:
                new_path = path + [grid[nx][ny]]
                heappush(min_heap, (new_path[-1], nx, ny, new_path))

