from heapq import heappop, heappush

def minPath(grid, k):
    N = len(grid)
    directions = [(0, 1), (1, 0), (-1, 0), (0, -1)]
    pos_val_dict = {(i, j): grid[i][j] for i in range(N) for j in range(N)}
    start_positions = sorted([(val, x, y) for (x, y), val in pos_val_dict.items()])

    def neighbors(x, y):
        for dx, dy in directions:
            if 0 <= x + dx < N and 0 <= y + dy < N:
                yield x + dx, y + dy

    def bfs(start_x, start_y):
        visited = {(start_x, start_y): [grid[start_x][start_y]]}
        queue = [(grid[start_x][start_y], start_x, start_y, [grid[start_x][start_y]])]
        while queue:
            _, x, y, path = heappop(queue)
            if len(path) == k:
                return path
            for nx, ny in neighbors(x, y):
                new_path = path + [grid[nx][ny]]
                if (nx, ny) not in visited or len(visited[(nx, ny)]) < len(new_path):
                    visited[(nx, ny)] = new_path
                    heappush(queue, (grid[nx][ny], nx, ny, new_path))
        return []

    for _, x, y in start_positions:
        path = bfs(x, y)
        if path:
            return path

    return []

