def starts_one_ends(n):
    """
    Given a positive integer n, return the count of the numbers of n-digit
    positive integers that start or end with 1.
    """
    if n == 1:
        return 1  # Only one number (1) of one-digit starts or ends with 1
    else:
        # For n > 1, 8 * 10^(n-2) numbers don't start or end with 1 in each position (start and end)
        # Total numbers of n-digits are 9 * 10^(n-1)
        # Subtract the numbers that neither start nor end with 1 from the total
        return 2 * (9 * 10**(n-1)) - 8 * 10**(n-2)

def encrypt(s):
    result = ''
    for char in s:
        if char.isalpha():
            shift = 2 * 2
            if char.islower():
                result += chr((ord(char) - 97 + shift) % 26 + 97)
            else:
                result += chr((ord(char) - 65 + shift) % 26 + 65)
        else:
            result += char
    return result

