def any_int(x, y, z):
    if not all(isinstance(i, int) for i in [x, y, z]):
        return False
    return x + y == z or x + z == y or y + z == x

def encode(message):
    """
    Encode a message by swapping case and replacing vowels with the letter that appears 2 places ahead.
    """
    vowels = 'aeiouAEIOU'
    vowel_replacement = {'a': 'c', 'A': 'C', 'e': 'g', 'E': 'G', 'i': 'k', 'I': 'K', 'o': 'q', 'O': 'Q', 'u': 'w', 'U': 'W'}
    encoded_message = ''

    for char in message:
        if char in vowels:
            encoded_message += vowel_replacement[char]
        else:
            encoded_message += char.swapcase()

    return encoded_message

def largest_prime_sum(lst):
