def get_odd_collatz(n):
    """
    Given a positive integer n, return a sorted list that has the odd numbers in collatz sequence.
    """
    odd_numbers = []
    while n != 1:
        if n % 2 != 0:
            odd_numbers.append(n)
        n = 3 * n + 1 if n % 2 else n // 2
    odd_numbers.append(1)  # Since the sequence always ends with 1.
    return sorted(odd_numbers)

def valid_date(date):
    # Check if the date string matches the required format
    if len(date) != 10 or date[2] != '-' or date[5] != '-':
        return False

    # Split the date into components
    parts = date.split('-')
    if len(parts) != 3:
        return False

    # Check if month, day, and year are integers
    try:
        month = int(parts[0])
        day = int(parts[1])
        year = int(parts[2])
    except ValueError:
        return False

    # Check the month range
    if month < 1 or month > 12:
        return False

    # Check the day range based on the month
    if month in [1, 3, 5, 7, 8, 10, 12]:
        if day < 1 or day > 31:
            return False
    elif month in [4, 6, 9, 11]:
        if day < 1 or day > 30:
            return False
    elif month == 2:
        if day < 1 or day > 29:
            return False

    return True

