            else:
                counter[num] = 1
    return lst == sorted(lst)

def intersection(interval1, interval2):
    def is_prime(n):
        if n <= 1:
            return False
        for i in range(2, int(n**0.5) + 1):
            if n % i == 0:
                return False
        return True

    start_max = max(interval1[0], interval2[0])
    end_min = min(interval1[1], interval2[1])
    if start_max > end_min:
        return "NO"
    else:
        intersection_length = end_min - start_max + 1
        return "YES" if is_prime(intersection_length) else "NO"

def prod_signs(arr):
    if not arr:
        return None
    sign_product = 1
    for num in arr:
        if num > 0:
            sign_product *= 1
        elif num < 0:
            sign_product *= -1
        else:
            sign_product *= 0
    magnitude_sum = sum(abs(num) for num in arr)
    return magnitude_sum * sign_product

def tri(n):
    def tribonacci_memo(n, memo):
        if n in memo:
            return memo[n]
        if n == 1:
            return 3
        if n % 2 == 0:
            result = 1 + n / 2
        else:
            result = tribonacci_memo(n - 1, memo) + tribonacci_memo(n - 2, memo) + tribonacci_memo(n + 1, memo)
        memo[n] = result
        return result

    memo = {1: 3}
    result = []
    for i in range(1, n + 2):  # Adjust to include tri(n) in the output
        if i not in memo:
            tribonacci_memo(i, memo)
        result.append(memo[i])
    return result[:n+1]  # Adjust to return the first n + 1 numbers

def digits(n):
    product = 1
    has_odd = False
    for digit in str(n):
        if int(digit) % 2 != 0:
            has_odd = True
            product *= int(digit)
    return product if has_odd else 0

def is_nested(string):
    stack = []
    for char in string:
        if char == '[':
            stack.append(char)
        elif char == ']':
            if stack:
                stack.pop()
            else:
                return False
    return len(stack) > 0

