def sort_third(l: list):
    # Extract the elements at indices divisible by 3
    divisible_by_three = [l[i] for i in range(len(l)) if i % 3 == 0]
    # Sort these elements
    divisible_by_three_sorted = sorted(divisible_by_three)
    # Replace the elements at indices divisible by 3 with their sorted counterparts
    for i in range(len(l)):
        if i % 3 == 0:
            l[i] = divisible_by_three_sorted.pop(0)
    return l

