def largest_prime_factor(n: int) -> int:
    def is_prime(num):
        if num <= 1:
            return False
        for i in range(2, int(num**0.5) + 1):
            if num % i == 0:
                return False
        return True

    prime_factor = 1
    # Check for divisibility by 2
    while n % 2 == 0:
        prime_factor = 2
        n //= 2
    # Check for odd factors
    for i in range(3, int(n**0.5) + 1, 2):
        while n % i == 0:
            prime_factor = i
            n //= i
    # If n is a prime number greater than 2
    if n > 2:
        prime_factor = n
    return prime_factor

