        return None
    sign_product = 1
    magnitude_sum = 0
    for num in arr:
        sign_product *= (1 if num > 0 else -1 if num < 0 else 0)
        magnitude_sum += abs(num)
    return magnitude_sum * sign_product

from heapq import heappop, heappush

def minPath(grid, k):
    N = len(grid)
    directions = [(0, 1), (1, 0), (-1, 0), (0, -1)]
    pq = [(grid[i][j], i, j, k-1, [grid[i][j]]) for i in range(N) for j in range(N)]
    visited = set()

    while pq:
        cost, x, y, steps, path = heappop(pq)
        if (x, y, steps) in visited:
            continue
        visited.add((x, y, steps))
        if steps == 0:
            return path
        for dx, dy in directions:
            nx, ny = x + dx, y + dy
            if 0 <= nx < N and 0 <= ny < N:
                new_path = path + [grid[nx][ny]]
                heappush(pq, (cost, nx, ny, steps-1, new_path))

    return []

def tri(n):
    if n == 0:
        return [1]
    if n == 1:
        return [1, 3]
    trib = [1, 3]
    for i in range(2, n + 1):
        if i % 2 == 0:
            trib.append(1 + i / 2)
        else:
            trib.append(trib[i - 1] + trib[i - 2] + trib[i - 1])
    return trib

